export const translateBrushCoordinates = (w, h, p) => {
  const width = 1592;
  const height = 1882;

  let nX = 0;
  let nY = 0;
  let nW = 0;
  let nH = 0;

  nX = (p.x * w) / width;
  nY = (p.y * h) / height;
  nW = (p.w * w) / width;
  nH = (p.h * h) / height;

  return { x: nX, y: nY, w: nW, h: nH };
};
